import React, { useEffect, useState } from "react";
import { Container, Row, Col, Table } from "reactstrap";
import Helmet from "../components/Helmet/Helmet";
import CommonSection from "../components/UI/CommonSection";
import DoctorItem from "../components/UI/DoctorItem";
//import drItem from "../pages/AddCar";
import axios from "axios";
import { createUrl, log } from "../utils/utils";

const DoctorListing = () => {
  const [doctor, setDoctor] = useState([]);

  useEffect(() => {
    loadDoctors();
  }, []);

  const loadDoctors = () => {
    const url = createUrl("/doctor");
    axios
      .get(url)
      .then(function (response) {
        setDoctor(response.data);
        log(response);
      })
      .catch(function (error) {
        log(error);
      });
  };

  return (
    <div>
      <Helmet title="Doctor">
        <CommonSection title="Doctor List" />
        <section>
          <Container>
            <Table striped>
              <thead>
                <tr>
                  <th>Doctor Name</th>
                  <th>Contact Number</th>
                  <th>Specialization</th>
                  <th>Day</th>
                  <th>Time</th>
                </tr>
              </thead>
              <tbody>
                {doctor.map((doctor, index) => (
                  <DoctorItem key={index} doctor={doctor} />
                ))}
              </tbody>
            </Table>
          </Container>
        </section>
      </Helmet>

      <div>
        <br></br>
        <hr></hr>
      </div>

      <div className="table-responsive">
        <table className="table-appointment">
          <thead>
            <tr>Fill Appointment Details</tr>
          </thead>

          <tbody>
            
          </tbody>
        </table>
      </div>
    </div>
  );
};
